static int handle_gdb_write_register(const char *buff, size_t len)
{
	uint32_t reg_num_gdb, reg_num_rm;
	const char *ptr, *dec;
	union minibuf value;

	static const int gdb_to_rm[] =
		/* EAX. */                           /* GS. */
		   {7,6,5,4,3,2,1,0,13,15,14,12,11,10,9,8};

	ptr = buff;

	expect_char('P', ptr, len);
	reg_num_gdb = read_int(ptr, &len, &ptr, 16);
	expect_char('=', ptr, len);
	dec = decode_hex(ptr, 4);

	memcpy(&value, dec, 4);

	/* Validate register. */
	if (reg_num_gdb >= 16)
	{
		send_gdb_error();
		return (-1);
	}

	reg_num_rm = gdb_to_rm[reg_num_gdb];

	/*
	 * Validate value: 16-bit registers should not
	 * receive values greater than 16-bit =)
	 */
	if (reg_num_rm >= 8 && value.b32 > ((1<<16)-1))
	{
		send_gdb_error();
		return (-1);
	}

	/* Update our 'cache'. */
	x86_regs.r32[reg_num_gdb] = value.b32;

	/* Send to our serial device. */
	send_serial_byte(SERIAL_STATE_REG_WRITE);
	send_serial_byte(reg_num_rm);
	send_serial_dword(value.b32);
	return (0);
}

void cmatrixqrunpackr(/* Complex */ ae_matrix *a,
                                    ae_int_t m,
                                    ae_int_t n,
    /* Complex */ ae_matrix *r,
                                    ae_state *_state) {
  ae_int_t i;
  ae_int_t k;

  ae_matrix_clear(r);

  if (m <= 0 || n <= 0) {
    return;
  }
  k = ae_minint(m, n, _state);
  ae_matrix_set_length(r, m, n, _state);
  for (i = 0; i <= n - 1; i++) {
    r->ptr.pp_complex[0][i] = ae_complex_from_i(0);
  }
  for (i = 1; i <= m - 1; i++) {
    ae_v_cmove(&r->ptr.pp_complex[i][0], 1, &r->ptr.pp_complex[0][0], 1, "N", ae_v_len(0, n - 1));
  }
  for (i = 0; i <= k - 1; i++) {
    ae_v_cmove(&r->ptr.pp_complex[i][i], 1, &a->ptr.pp_complex[i][i], 1, "N", ae_v_len(i, n - 1));
  }
}

